// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

library CheckTime {
    using SafeMath for uint256;

    uint256 public constant DAYS = 86400;
    uint256 public constant MAXLIFE = 5;
    uint256 public constant TIMEDEFAULT = 1647216000;

    function checkTime(uint256[] memory array) internal pure returns (bool) {
        uint256 calcuTime;
        calcuTime = array[array.length - 1].sub(TIMEDEFAULT);
        if (calcuTime <= DAYS) {
            return true;
        } else {
            return false;
        }
    }
}
